import React from 'react';
import { Link } from 'react-router-dom';

export default function Meme1(props) {
    return (

        <div style={{textAlign:'center'}}>
            <form>
                <label className="name">UserName</label>
                <input type="text" /><br /><br />
                <label className="pass">Password</label>
                <input type="text" /><br /><br />
                <label className="text1">Text1</label>
                <input type="text" /><br /><br />
                <label className="text2">Text2</label>
                <input type="text" /><br /><br />
                <Link to="/res"><button className="btn1">Click here</button></Link><br /><br />
                <img src={this.props.source} alt="No image"/>
            </form>
        </div>
    )
}
